    false,nt"url": null,nt"notes": "BPI Zones are derived from a focal mean
    analysis on bathymetry and slope. The grid is based on gridded (60 m cell size)
    multibeam bathymetry, collected aboard R/V AHI and bathymetry derived from multispectral
    IKONOS satellite imagery. It was created using the Benthic Terrain Modeler (http://www.csc.noaa.gov/products/btm/).
    Cell values represent one of 4 classes (crest, depression, flat, slope) in an index
    of seafloor terrains. This data set is for Wake Island, West Central Pacific.",nt"owner_org":
